import React, { useState , useEffect } from 'react'
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import LandingPage from './components/LandingPage/LandingPage'; // Corrected path
import Find from './components/Find/Find'; // Import the Find component
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
     <Router>
      <AppAppBar /> {/* Top-level app bar component */}
      <Routes>
        <Route exact path="/" element={<Index />} /> {/* Home page */}
        <Route exact path="/user" element={<User />} /> {/* User profile page */}
        <Route exact path="/dashboard" element={<Dashboard />} /> {/* Dashboard */}
        <Route exact path="/exercise" element={<Exercises />} /> {/* Exercises page */}
        <Route path="*" element={<Error />} /> {/* Catch-all for unmatched paths */}
      </Routes>
    </Router>

    </>
  )
}

export default App;
